import React from "react";
import {
  EmailShareButton,
  FacebookShareButton,
  LinkedinShareButton,
  TwitterShareButton,
} from "react-share";

function Header() {
  return (
    <div className="header">
      <div className="headerText">version 1</div>
        <LinkedinShareButton size={32} round={true} url="https://engagementtracker.net" />
        <TwitterShareButton size={32} round={true} url="https://engagementtracker.net" />
        <FacebookShareButton size={32} round={true} url="https://engagementtracker.net" />
        <EmailShareButton size={32} round={true} url="https://engagementtracker.net" />
    </div>
  );
}

export default Header;
